import "./App.css";
import React, { useState } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import ReactPlayer from "react-player";
import myVideo from "../src/test.MOV";

function Home() {
  const handleClick = () => {
    window.location.href = "/first";
  };
  return (
    <div className="container">
      <div className="question">Love Me?</div>
      <div className="choice-button">
        <button onClick={handleClick}>Yes</button>
      </div>
    </div>
  );
}

function First() {
  const [password, setPassword] = useState("");

  const onChange = (e) => {
    setPassword(e.target.value);
  };

  const handleLogin = () => {
    if (password === "120613") {
      window.location.href = "/second";
    } else {
      alert("우리 집 안올거야?");
    }
  };

  return (
    <div className="container">
      <div className="question">Home password?</div>
      <div className="answer-input">
        <input
          className="input"
          type={"number"}
          onChange={onChange}
          value={password}
        ></input>
      </div>
      <div className="choice-button">
        <button onClick={handleLogin}>Login</button>
      </div>
    </div>
  );
}

function Second() {
  const [password, setPassword] = useState("");

  const onChange = (e) => {
    setPassword(e.target.value);
  };

  const handleLogin = () => {
    if (password === "umbrella") {
      window.location.href = "/third";
    } else {
      alert("ㅇ△ㅁ?");
    }
  };

  return (
    <div className="container">
      <div className="question-paragraph">
        <p>
          그 날은 겨울이지만 춥지 않았어요. 재혁이를 만나 놀러가는 길이었는데,
        </p>
        <p>
          친구의 생일이어서 버스에서 문자를 보내다 멀미가 날 뻔도 했죠. 40분
          정도 버스를 타야해서 그런지 깜빡 졸았어요.
        </p>
        <p>
          눈을 다시 떠보니 재혁이가 햇빛을 손으로 막아주고 있더라구요. 예뻐
          죽겠어요 진짜.
        </p>
        <p>
          그 날 점심에 재혁이가 저한테 뭘 만들어줬는지 아세요? 진짜 너무 웃어서
          기절할 뻔 했잖아요 (웃음).
        </p>
        <p>
          그걸 만들고 난 뒤에 웃는 재혁이 모습이 얼마나 귀엽던지. 영상으로
          남겨놓기를 잘했어요
        </p>
      </div>
      <div className="answer-input">
        <input
          className="input"
          type={"password"}
          onChange={onChange}
          value={password}
        ></input>
      </div>
      <div className="choice-button">
        <button onClick={handleLogin}>submit</button>
      </div>
    </div>
  );
}

function Third() {
  const [password, setPassword] = useState("");

  const onChange = (e) => {
    setPassword(e.target.value);
  };

  const handleLogin = () => {
    if (password === "300") {
      window.location.href = "/fourth";
    } else {
      alert("날이 좋아서, 날이 좋지 않아서");
    }
  };
  return (
    <div className="container">
      <div className="question-paragraph">
        <p>한반도 동쪽 끝자락 몸에 칼을 꽂은 남자가 내게 물었다.</p>
        <p>"내 신부가 되어줄래?"</p>
        <p>나는 말했다.</p>
        <p>"저 이미 재혁이랑 결혼하기로 했는데요?"</p>
        <p>
          몸에 칼을 꽂은 남자가 슬퍼하며 유유히 빨간 등대 저편으로 사라졌다.
          나는 황당했다.
        </p>
        <p>
          "뭐야... 역에서 xxx번 버스 타고 50분이나 달려왔는데 이상한 사람
          만났어."
        </p>
      </div>
      <div className="answer-input">
        <input
          className="input"
          type={"number"}
          onChange={onChange}
          value={password}
        ></input>
      </div>
      <div className="choice-button">
        <button onClick={handleLogin}>submit</button>
      </div>
    </div>
  );
}

function Fourth() {
  const [password, setPassword] = useState("");

  const onChange = (e) => {
    setPassword(e.target.value);
  };

  const handleLogin = () => {
    if (password === "17") {
      window.location.href = "/fifth";
    } else {
      alert("10001");
    }
  };

  return (
    <div className="container">
      <div className="question-paragraph">
        <p>재혁이와 함께한 첫 번째 크리스마스</p>
        <p>
          선물도 주고받고 즐거운 하루를 보냈지만 너무너무너무너무 추웠어요ㅜㅠ
        </p>
        <p>집에 가는 길에 다음날 날씨를 확인한 저는 놀라서 말했어요</p>
        <p>"와 자기야"</p>
        <p>"내일은 영하 ?도래"</p>
      </div>
      <div className="answer-input">
        <input
          className="input"
          type={"number"}
          onChange={onChange}
          value={password}
        ></input>
      </div>
      <div className="choice-button">
        <button onClick={handleLogin}>submit</button>
      </div>
    </div>
  );
}

function Fifth() {
  const [password, setPassword] = useState("");

  const onChange = (e) => {
    setPassword(e.target.value);
  };

  const handleLogin = () => {
    if (password === "CodingKim") {
      window.location.href = "/sixth";
    } else {
      alert("야 김코딩! 여름이었다.");
    }
  };

  return (
    <div className="container">
      <div className="question-paragraph">
        <p>오늘은 이웃집 비버의 생일이에요.</p>
        <p>
          비버를 사랑하는 저랑 재혁이는 비버를 위한 선물을 정성들여 준비했어요!
        </p>
        <p>재혁이는 역시 코딩할 때 제일 섹시해요ㅎㅅㅎ</p>
        <p>닉값을 제대로 한다니까요?</p>
        <p>재혁이 별명이 뭐냐구요? 그건 재혁이가 쓴 코드에 나와있어요!</p>
      </div>
      <div className="answer-input">
        <input
          className="input"
          type={"password"}
          onChange={onChange}
          value={password}
        ></input>
      </div>
      <div className="choice-button">
        <button onClick={handleLogin}>submit</button>
      </div>
    </div>
  );
}

function Sixth() {
  const [password, setPassword] = useState("");

  const onChange = (e) => {
    setPassword(e.target.value);
  };

  const handleLogin = () => {
    if (password === "1272") {
      window.location.href = "/seventh";
    } else {
      alert("E = 2, O = 0, I = 1, S = 5"); //2XP0 + F1R2BA52 = 20 + 1252 = 1272
    }
  };

  return (
    <div className="container">
      <div className="question-paragraph">
        <p>마침내 도착한 피지피, 혁이와 함께하는 행복한 코딩도비 라이프.</p>
        <p>얼마나 행복한지 생일 선물도 코딩으로 준비하고 있다니까요 하하 ^0^</p>
        <p>
          리액트를 써보니까 리액트 네이티브가 얼마나 거지같았는지 알 것
          같아요ㅎㅎ
        </p>
        <p>특히나 혁이를 억까했던 그 자식... 용서하지 않을거에요</p>
        <p>xxxx + xxxxxxxx</p>
        <p>
          그냥 욕하면 고소당할테니 알파벳을 숫자로 바꿔서 욕할게요ㅎㅎ 물론 바꿀
          수 있는 글자만이요!
        </p>
      </div>
      <div className="answer-input">
        <input
          className="input"
          type={"number"}
          onChange={onChange}
          value={password}
        ></input>
      </div>
      <div className="choice-button">
        <button onClick={handleLogin}>submit</button>
      </div>
    </div>
  );
}

function Seventh() {
  const [password, setPassword] = useState("");

  const onChange = (e) => {
    setPassword(e.target.value);
  };

  const handleLogin = () => {
    if (password === "하루의") {
      window.location.href = "/ending";
    } else {
      alert("혹시 submit 버튼이 다른 단어로 바뀌지 않았나요?");
    }
  };

  return (
    <div className="container">
      <div className="question-paragraph">
        <p>열심히 사는 혁이를 보며 멋지다 배워야겠다 생각해요.</p>
        <p>
          언제나 좋은 자극이 되어주는 우리 혁이! 가끔은 너무 바빠보여 걱정되기도
          하지만요...
        </p>
        <br></br>
        <p>
          재혁아 나는 너가 힘들 때 곁에 있어주고 안아주고 들어주고 위로해줄 수
          있어서 행복해
        </p>
        <p>남들보다 늦게 문을 닫는 우리 하루가 조금 더 포근했으면 해</p>
        <p>많이 사랑해♡</p>
      </div>
      <div className="answer-input">
        <input
          className="input"
          type={"text"}
          onChange={onChange}
          value={password}
        ></input>
      </div>
      <div className="choice-button">
        <button onClick={handleLogin}>끝</button>
      </div>
    </div>
  );
}

function Ending() {
  return (
    <div className="container">
      <div className="question-paragraph">
        <ReactPlayer url={myVideo} />
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/first">
            <First />
          </Route>
          <Route path="/second">
            <Second />
          </Route>
          <Route path="/third">
            <Third />
          </Route>
          <Route path="/fourth">
            <Fourth />
          </Route>
          <Route path="/fifth">
            <Fifth />
          </Route>
